import React from "react";
import { Grid } from "@material-ui/core";
import { Slider } from "./Slider";
import { matchPc, matchTablet } from "../DetectDevice";
function Profile() {
  const images = ["1.png", "2.png", "3.png", "4.png"];

  return (
    <>
      <Grid
        container
        style={{
          position: "relative",
        }}
      >
        <Grid
          item
          xs={12}
          sm={6}
          style={{
            position: "relative",
            height: "auto",
            marginTop: "-1px",
            padding: matchPc ? "8px" : "0px",
          }}
        >
          <Slider slides={images} />
          <Grid item xs={12} style={{ height: "0px" }}></Grid>
        </Grid>

        <Grid
          item
          xs={12}
          sm={6}
          style={{
            position: "relative",
            height: "auto",
            marginTop: "-1px",
            padding: matchPc ? "8px" : "0px",
          }}
        >
          <Slider slides={images} />
          <Grid item xs={12} style={{ height: "0px" }}></Grid>
        </Grid>

        <Grid
          item
          xs={12}
          sm={6}
          style={{
            position: "relative",
            height: "auto",
            marginTop: "-1px",
            padding: matchPc ? "8px" : "0px",
          }}
        >
          <Slider slides={images} />
          <Grid item xs={12} style={{ height: "0px" }}></Grid>
        </Grid>

        <Grid
          item
          xs={12}
          sm={6}
          style={{
            position: "relative",
            height: "auto",
            marginTop: "-1px",
            padding: matchPc ? "8px" : "0px",
          }}
        >
          <Slider slides={images} />
          <Grid item xs={12} style={{ height: "0px" }}></Grid>
        </Grid>
      </Grid>
    </>
  );
}

export default Profile;
